import React from "react";
import { Grid, Block } from "./styles";
import Icon, {
  FundTwoTone,
  PieChartTwoTone,
  FunnelPlotTwoTone,
  CalculatorTwoTone,
  ContactsTwoTone,
} from "@ant-design/icons";

const Blocks = () => {
  return (
    <>
      <Grid>
        <Block>
          <Icon component={FundTwoTone} style={{ fontSize: "25px" }}></Icon>
          <h4>Total Sales</h4>
          <p>0.000</p>
        </Block>
        <Block>
          <Icon component={ContactsTwoTone} style={{ fontSize: "25px" }}></Icon>
          <h4>Transactions</h4>
          <p>0.000</p>
        </Block>
        <Block>
          <Icon
            component={FunnelPlotTwoTone}
            style={{ fontSize: "30px" }}
          ></Icon>
          <h4>Total Item Sold</h4>
          <p>0.000</p>
        </Block>
        <Block>
          <Icon
            component={CalculatorTwoTone}
            style={{ fontSize: "30px" }}
          ></Icon>

          <h4>Cost of Goods</h4>
          <p>0.000</p>
        </Block>
        <Block>
          <Icon component={PieChartTwoTone} style={{ fontSize: "25px" }}></Icon>
          <h4>Profit</h4>
          <p>0.000</p>
        </Block>
      </Grid>
    </>
  );
};

export default Blocks;
